    playbackData.comments = {"ev-0":[{"id":"commentId-0","displayCommentEvent":{"id":"ev-0","timestamp":1662643670944,"createdByDevGroupId":"devGroupId-1","eventSequenceNumber":0,"permanentRelevance":"never relevant","type":"CREATE DIRECTORY","directoryId":"dirId-0","directoryPath":"/","parentDirectoryId":null},"developerGroupId":"devGroupId-1","timestamp":1662643670948,"commentText":"<div>In this program I will discuss how to create variables in Ruby programs.</div><div><br></div><div>Local variables, method parameters, and method names <span style=\"font-style: italic;\">must</span> all start with lowercase letters.<br><br>When creating local variables, you don't need to specify types. Each variable does have a type but it is determined based on <span style=\"font-style: italic;\">how it is used</span>.<br><br>So, we dont do things like this in Ruby:<br><span style=\"font-family: Courier;\">String name = new String();<br>int age;<br>age = 49;</span></div><div><br></div><div>Ruby infers the type of a variable from the value that is stored inside of it.<br></div>","commentTitle":"","selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"ev-16":[{"id":"commentId-1","displayCommentEvent":{"id":"ev-16","timestamp":1662643814738,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":16,"type":"INSERT","fileId":"fileId-0","character":"\"","previousNeighborId":"ev-15","lineNumber":1,"column":15,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1662644026827,"commentText":"The Ruby interpreter figures out that the programmer wants to create a variable called <span style=\"font-family: Courier;\">name</span>. It also determines that the type of the variable is a string because of the double quotes.","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"name = \"Markus\"","startRow":0,"startColumn":0,"endRow":0,"endColumn":15}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/02.rb","viewableBlogText":"name = \"Markus\"","commentTags":[],"questionCommentData":null}],"ev-25":[{"id":"commentId-2","displayCommentEvent":{"id":"ev-25","timestamp":1662644037362,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":25,"type":"INSERT","fileId":"fileId-0","character":"9","previousNeighborId":"ev-24","lineNumber":2,"column":8,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1662644093978,"commentText":"And here it creates a variable called <span style=\"font-family: Courier;\">age</span> and determines that it is an integer. Integers do not have decimal points in them. <br>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"age = 49","startRow":1,"startColumn":0,"endRow":1,"endColumn":8}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/02.rb","viewableBlogText":"age = 49","commentTags":[],"questionCommentData":null}],"ev-39":[{"id":"commentId-3","displayCommentEvent":{"id":"ev-39","timestamp":1662644105271,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":39,"type":"INSERT","fileId":"fileId-0","character":"5","previousNeighborId":"ev-38","lineNumber":3,"column":13,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1662644177829,"commentText":"The <span style=\"font-family: Courier;\">height</span> variable is a floating point number (a number with a decimal point).","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"height = 71.5","startRow":2,"startColumn":0,"endRow":2,"endColumn":13}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/02.rb","viewableBlogText":"height = 71.5","commentTags":[],"questionCommentData":null}],"ev-64":[{"id":"commentId-4","displayCommentEvent":{"id":"ev-64","timestamp":1662644205754,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":64,"type":"INSERT","fileId":"fileId-0","character":"s","previousNeighborId":"ev-63","lineNumber":5,"column":23,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1662644744164,"commentText":"<div>The <span style=\"font-family: Courier;\">age</span> variable is not a string, it is an int. <span style=\"font-family: Courier;\">puts</span> only prints strings. In order to print it with <span style=\"font-family: Courier;\">puts</span> I need to convert it to a string.&nbsp;</div><div><br></div><div><span style=\"font-family: Courier;\">to_s</span> is the conversion method to change an object into a string. This method is available on every variable.<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"age.to_s","startRow":4,"startColumn":15,"endRow":4,"endColumn":23}],"imageURLs":["media/images/1662644737179-01.png"],"videoURLs":[],"audioURLs":[],"linesAbove":4,"linesBelow":0,"currentFilePath":"/02.rb","viewableBlogText":"name = \"Markus\"\nage = 49\nheight = 71.5\n\nputs \"Age: \" + age.to_s","commentTags":["image","successful-run"],"questionCommentData":null}],"ev-74":[{"id":"commentId-5","displayCommentEvent":{"id":"ev-74","timestamp":1662644249881,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":74,"type":"INSERT","fileId":"fileId-0","character":"#","previousNeighborId":"ev-41","lineNumber":5,"column":1,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1662644841280,"commentText":"It turns out that if you pass in something other than a string to <span style=\"font-family: Courier;\">puts</span> it will call <span style=\"font-family: Courier;\">to_s</span> automatically for you. So, the highlighted code works too.<br>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"puts age","startRow":5,"startColumn":0,"endRow":5,"endColumn":8}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":1,"linesBelow":0,"currentFilePath":"/02.rb","viewableBlogText":"#puts \"Age: \" + age.to_s\nputs age","commentTags":["successful-run"],"questionCommentData":null}],"ev-112":[{"id":"commentId-6","displayCommentEvent":{"id":"ev-112","timestamp":1662644292482,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":112,"type":"INSERT","fileId":"fileId-0","character":"s","previousNeighborId":"ev-111","lineNumber":9,"column":4,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1662644949137,"commentText":"<div>Ruby allows you to embed variables in a string using the syntax: <br></div><div><span style=\"font-family: Courier;\"><br></span></div><div><span style=\"font-family: Courier;\">\"text #{variable} text\"</span><br></div><div><br></div><div>This is called <span style=\"font-style: italic;\">string interpolation</span>.</div><div><br></div><div>Here, instead of appending strings and variables together I put them all together in one string. See the attached screenshot.</div><div><br></div><div>This is a really nice way of dealing with strings and variables.<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"puts \"#{name}'s age is #{age}\"","startRow":7,"startColumn":0,"endRow":7,"endColumn":30}],"imageURLs":["media/images/1662644937914-02.png"],"videoURLs":[],"audioURLs":[],"linesAbove":7,"linesBelow":0,"currentFilePath":"/02.rb","viewableBlogText":"name = \"Markus\"\nage = 49\nheight = 71.5\n\n#puts \"Age: \" + age.to_s\n#puts age\n\nputs \"#{name}'s age is #{age}\"","commentTags":["image","successful-run"],"questionCommentData":null}],"ev-252":[{"id":"commentId-7","displayCommentEvent":{"id":"ev-252","timestamp":1662644343710,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":252,"type":"INSERT","fileId":"fileId-0","character":"\"","previousNeighborId":"ev-251","lineNumber":18,"column":30,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1662646030413,"commentText":"The <span style=\"font-family: Courier;\">gets</span> method gets some input from the keyboard. It returns a whole string of text up to and including the newline that was generated by pressing the 'enter' key.","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"name = gets","startRow":11,"startColumn":0,"endRow":11,"endColumn":11}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":1,"linesBelow":6,"currentFilePath":"/02.rb","viewableBlogText":"puts \"Enter a new name, I don't like #{name}\"\nname = gets\nname.chomp!\n\nputs \"Enter an age\"\nage = gets.to_i\n\nputs \"#{name}'s age is #{age}\"","commentTags":[],"questionCommentData":null},{"id":"commentId-8","displayCommentEvent":{"id":"ev-252","timestamp":1662644343710,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":252,"type":"INSERT","fileId":"fileId-0","character":"\"","previousNeighborId":"ev-251","lineNumber":18,"column":30,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1662646283848,"commentText":"<div>The <span style=\"font-family: Courier;\">chomp!</span> method strips off the newline at the end using the string.&nbsp;</div><div><br></div><div>The <span style=\"font-family: Courier;\">!</span> at the end means it will change the string. The variable, <span style=\"font-family: Courier;\">name</span>, will be updated to remove the newline.</div><div><br></div><div>There is another version of <span style=\"font-family: Courier;\">chomp</span> that doesn't end with a <span style=\"font-family: Courier;\">!</span>. When this version of the method is called a new string is created without the newline and it is returned. However, the original <span style=\"font-family: Courier;\">name</span> variable is unchanged. <br></div><div><br></div><div>In general, all methods that change an object's instance data should end with a <span style=\"font-family: Courier;\">!</span> (unless it is a setter).</div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"name.chomp!","startRow":12,"startColumn":0,"endRow":12,"endColumn":11}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":2,"linesBelow":5,"currentFilePath":"/02.rb","viewableBlogText":"puts \"Enter a new name, I don't like #{name}\"\nname = gets\nname.chomp!\n\nputs \"Enter an age\"\nage = gets.to_i\n\nputs \"#{name}'s age is #{age}\"","commentTags":[],"questionCommentData":null},{"id":"commentId-9","displayCommentEvent":{"id":"ev-252","timestamp":1662644343710,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":252,"type":"INSERT","fileId":"fileId-0","character":"\"","previousNeighborId":"ev-251","lineNumber":18,"column":30,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1662646548425,"commentText":"<div><span style=\"font-family: Courier;\">gets</span> always returns a string. I would like to do some arithmetic with the <span style=\"font-family: Courier;\">age</span> variable so I need to convert the string that <span style=\"font-family: Courier;\">gets</span> returns into an integer.</div><div><br><span style=\"font-family: Courier;\"></span></div><div>I can convert the string to an integer by calling the <span style=\"font-family: Courier;\">to_i</span>&nbsp;method (convert to an integer) on the return value from <span style=\"font-family: Courier;\">gets</span>.</div><div><br></div><div>The attached screenshot shows a prompt for a name and age and how to echo it back to the user.<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"age = gets.to_i","startRow":15,"startColumn":0,"endRow":15,"endColumn":15}],"imageURLs":["media/images/1662646572961-03.png"],"videoURLs":[],"audioURLs":[],"linesAbove":5,"linesBelow":2,"currentFilePath":"/02.rb","viewableBlogText":"puts \"Enter a new name, I don't like #{name}\"\nname = gets\nname.chomp!\n\nputs \"Enter an age\"\nage = gets.to_i\n\nputs \"#{name}'s age is #{age}\"","commentTags":["image","successful-run"],"questionCommentData":null}],"ev-317":[{"id":"commentId-10","displayCommentEvent":{"id":"ev-317","timestamp":1662644386559,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":317,"type":"INSERT","fileId":"fileId-0","character":"s","previousNeighborId":"ev-316","lineNumber":24,"column":4,"pastedEventId":"ev-274"},"developerGroupId":"devGroupId-2","timestamp":1662646667395,"commentText":"<div>Here I add 10 to the entered age and print it again. See the attached screenshot.<br></div><div><br></div><div>The 'add-and-equals' operator, <span style=\"font-family: Courier;\">+=</span>, is equivalent to this code:</div><div><br></div><div><span style=\"font-family: Courier;\">age = age + 10</span><br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"age += 10","startRow":21,"startColumn":0,"endRow":21,"endColumn":9},{"fileId":"fileId-0","selectedText":"name","startRow":22,"startColumn":21,"endRow":22,"endColumn":25},{"fileId":"fileId-0","selectedText":"age","startRow":22,"startColumn":37,"endRow":22,"endColumn":40}],"imageURLs":["media/images/1662646649366-04.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/02.rb","viewableBlogText":"age += 10\nputs \"In ten years #{name} will be #{age}\"","commentTags":["image","successful-run"],"questionCommentData":null}],"ev-347":[{"id":"commentId-11","displayCommentEvent":{"id":"ev-347","timestamp":1662644424960,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":347,"type":"INSERT","fileId":"fileId-0","character":"\"","previousNeighborId":"ev-346","lineNumber":27,"column":18,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1662646742854,"commentText":"Ruby has constants. Constants <span style=\"font-style: italic;\">must</span> start with an uppercase letter. Here I create a constant for pi and print it.<br>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"PI = 3.14\nputs \"Pi is #{PI}\"","startRow":25,"startColumn":0,"endRow":26,"endColumn":18}],"imageURLs":["media/images/1662646739912-05.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/02.rb","viewableBlogText":"PI = 3.14\nputs \"Pi is #{PI}\"","commentTags":["image","successful-run"],"questionCommentData":null}],"ev-385":[{"id":"commentId-12","displayCommentEvent":{"id":"ev-385","timestamp":1662644504489,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":385,"type":"INSERT","fileId":"fileId-0","character":"\"","previousNeighborId":"ev-384","lineNumber":31,"column":22,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1662646820731,"commentText":"<div>In Ruby, you can change the value of a constant (wtf?). However, if you do this then you will get a warning message (see the attached screenshot).&nbsp;</div><div><br></div><div>This is why non-constant variables must start with a lowercase letter. </div><div><br></div><div>Ruby is a really interesting language. You will see many clever language features that did not exist before. This is a good example, it simply prints a warning when a variable that starts with an uppercase letter changes. <br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"PI = 3.14159","startRow":28,"startColumn":0,"endRow":28,"endColumn":12},{"fileId":"fileId-0","selectedText":"PI","startRow":30,"startColumn":18,"endRow":30,"endColumn":20}],"imageURLs":["media/images/1662646816273-06.png"],"videoURLs":[],"audioURLs":[],"linesAbove":3,"linesBelow":0,"currentFilePath":"/02.rb","viewableBlogText":"PI = 3.14\nputs \"Pi is #{PI}\"\n\nPI = 3.14159\n\nputs \"Pi is now #{PI}\"","commentTags":["image","successful-run"],"questionCommentData":null}]};
